  <label for="eventoSel" style="display:block;margin-bottom:4px;">Evento:</label>

<script>
(function() {
  var MAP_VAR_NAME = "map_2f68ce9c35284880b2c300d31af69405";

  var COLOR_MAP = {"tosferina":"#e41a1c","dengue":"#377eb8","malaria":"#4daf4a"};

  function whenReady(cb) {
    var tries = 0;
    (function wait() {
      var map = window[MAP_VAR_NAME];
      var base = window[BASE_NAME];
      var layersReady = EVENT_ENTRIES.every(function(o) { return !!window[o.varname]; });
      if (map && base && layersReady && window.leafletImage) cb(map, base);
      else if (tries++ < 200) setTimeout(wait, 50);
    })();
  }

  function fitVeryTight(map, base) {
    try {
      var b = base.getBounds();
      // Zoom máximo que quepa
      var z = map.getBoundsZoom(b, true);
      if (z > (map.options.maxZoom || 22)) z = (map.options.maxZoom || 22);
      map.setView(b.getCenter(), z, {animate:false});
    } catch(e) {
      console.warn(e);
    }
  }

  function wire(map, base) {
    // Ajuste inicial y tras cambios de tamaño
    function fitAll() {
      fitVeryTight(map, base);
      requestAnimationFrame(function(){ fitVeryTight(map, base); });
      setTimeout(function(){ fitVeryTight(map, base); }, 100);
    }
    map.whenReady(fitAll);
    map.on('resize', fitAll);

    function getLayer(o) { return window[o.varname]; }
    function hideAll() {
      EVENT_ENTRIES.forEach(function(o) {
        var layer = getLayer(o);
        if (layer && map.hasLayer(layer)) map.removeLayer(layer);
      });
    }
    function setOnly(name) {
      EVENT_ENTRIES.forEach(function(o) {
        var layer = getLayer(o);
        if (!layer) return;
        if (o.label === name) {
          if (!map.hasLayer(layer)) map.addLayer(layer);
        } else {
          if (map.hasLayer(layer)) map.removeLayer(layer);
        }
      });
      var panes = map.getPanes();
      if (panes && panes.markerPane) panes.markerPane.style.zIndex = 10000;
    }

    hideAll();

    var sel = document.getElementById('eventoSel');
    var colorBox = document.getElementById('colorBox');
    var colorName = document.getElementById('colorName');
    var fontSlider = document.getElementById('fontSlider');
    var fontVal = document.getElementById('fontVal');
    var btnExport = document.getElementById('btnExport');
    var container = map.getContainer();

    sel.addEventListener('change', function() {
      var chosen = sel.value;
      if (chosen) {
        setOnly(chosen);
        colorBox.style.background = COLOR_MAP[chosen] || '#ccc';
        colorName.textContent = chosen;
      } else {
        hideAll();
        colorBox.style.background = '#ccc';
        colorName.textContent = 'Color del evento';
      }
    });

    fontSlider.addEventListener('input', function() {
      var v = Math.max(4, Math.min(14, parseInt(fontSlider.value||12,10)));
      fontVal.textContent = v;
      document.documentElement.style.setProperty('--munLabelSize', v + 'px');
    });

    // Selección inicial (si hay al menos un evento)
    if (sel.options.length > 1) {
      sel.selectedIndex = 1;
      var initial = sel.value;
      setOnly(initial);
      colorBox.style.background = COLOR_MAP[initial] || '#ccc';
      colorName.textContent = initial || 'Color del evento';
    }

    // Exportar exactamente lo que se ve (panel incluido), con fondo transparente
    btnExport.addEventListener('click', function() {
      btnExport.disabled = true;
      var prevMapBg = container.style.backgroundColor;
      var prevBodyBg = document.body.style.backgroundColor;

      container.style.backgroundColor = 'transparent';
      document.body.style.backgroundColor = 'transparent';

      // Espera un frame para asegurar estilos aplicados
      requestAnimationFrame(function() {
        leafletImage(map, function(err, canvas) {
          // Restaurar estilos SIEMPRE
          container.style.backgroundColor = prevMapBg;
          document.body.style.backgroundColor = prevBodyBg;
          btnExport.disabled = false;

          if (err || !canvas) {
            console.error(err || 'canvas nulo');
            alert('No se pudo exportar el PNG en este navegador.');
            return;
          }
          var link = document.createElement('a');
          link.href = canvas.toDataURL('image/png');
          link.download = 'meta_evento.png';
          // Algunos navegadores requieren que el enlace esté en el DOM:
          document.body.appendChild(link);
          link.click();
          setTimeout(function(){ document.body.removeChild(link); }, 0);
        });
      });
    });
  }

  whenReady(wire);
})();
</script>
